class EmojiTestScreen extends StatelessWidget {
  const EmojiTestScreen({Key key}) : super(key: key);

  Future<void> onEmojiTap({BuildContext context, EmojiModel emo, int index}) async {

    await BottomDialog.showBottomDialog(
      context: context,
      title: '${emo.emoji}  ${emo.name}',
      height: 400,
      draggable: true,
      child: Container(
        width: BottomDialog.dialogClearWidth(context),
        height: BottomDialog.dialogClearHeight(draggable: true, context: context, titleIsOn: true, overridingDialogHeight: 400),
        color: Colorz.bloodTest,
        child: SuperVerse(
          verse: '$index : ${emo.code}',

        ),
      ),
    );

  }


  @override
  Widget build(BuildContext context) {

    final List<EmojiModel> _emojis = EmojiModel.allEmojis();

    // double _screenWidth = Scale.superScreenWidth(context);

    return MainLayout(
        pageTitle: 'Emojis',
        pyramids: Iconz.PyramidzYellow,
        appBarType: AppBarType.Basic,
        layoutWidget: GridView.builder(
          itemCount: _emojis.length,
            padding: const EdgeInsets.only(top: Ratioz.stratosphere, bottom: 100),
            gridDelegate: const SliverGridDelegateWithFixedCrossAxisCount(
              crossAxisCount: 7,
              mainAxisSpacing: 2.5,
              crossAxisSpacing: 2.5,
              childAspectRatio: 1  / 1,
            ),
            itemBuilder: (BuildContext ctx, int index){

              final EmojiModel _emoji = _emojis[index];

              return
                DreamBox(
                  height: 50,
                  width: 50,
                  verse: '${_emoji.emoji}',
                  verseScaleFactor: 1,
                  verseWeight: VerseWeight.thin,
                  // margins: EdgeInsets.symmetric(horizontal: 2.5),
                  onTap: () => onEmojiTap(
                    context: context,
                    emo: _emoji,
                    index: index,
                  ),
                );

            }
        ),


    );
  }
}

